import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  filters: {
    flex: 1,
    backgroundColor: "#E5E5E5",
  },
  button: {
    alignSelf: "center",
    backgroundColor: "#272727",
    textAlign: "center",
    paddingVertical: "auto",
    width: 260,
    height: 53,
    margin: 27,
    alignItems: "center",
    justifyContent: "center",
  },
  buttonText: {
    color: "white",
    fontSize: 16,
    lineHeight: 19,
    height: 19,
  },
});
